// import item1 from "../img/item-1.png";
// import item2 from "../img/item-2.png";
// import item3 from "../img/item-3.png";
// import item4 from "../img/item-4.png";
// import item5 from "../img/item-5.png";
// import item6 from "../img/item-6.png";
// import item7 from "../img/item-7.png";
// import item8 from "../img/item-8.png";
// import item9 from "../img/item-9.png";
import TheItem from "./TheItem";
// const itemPIC = [item1, item2, item3, item4, item5, item6, item7, item8, item9];
class Products extends React.Component {
  render() {
    return (
      <section className="items">
        <div className="container">
          <TheItem title={props.items[0].name} pic={props.items[0].image} />
          <TheItem title={props.items[1].name} pic={props.items[1].image} />
          <TheItem title={props.items[2].name} pic={props.items[2].image} />
          <TheItem title={props.items[3].name} pic={props.items[3].image} />
          <TheItem title={props.items[4].name} pic={props.items[4].image} />
          <TheItem title={props.items[5].name} pic={props.items[5].image} />
          <TheItem title={props.items[6].name} pic={props.items[6].image} />
          <TheItem title={props.items[7].name} pic={props.items[7].image} />
          <TheItem title={props.items[8].name} pic={props.items[8].image} />
        </div>
        <button>MORE PRODUCTS</button>
      </section>
    );
  }
}

export default Products;
